     * 将来的rowKey 使用 0000_ 来开头, 则 0000_一定会落在  无穷->0000| 之间, 因为 "_"比"|"小
     *
     * @return 存储预分区键的二维字节数组
     */
    public static byte[][] getSplitKeys() {

        // 创建存储预分区键的二维字节数组
        byte[][] splitKeys = new byte[regions][];
        for (int i = 0; i  conf = descriptor.getConfiguration();
            return true;
        } catch (IOException e) {
            return false;
        } finally {
            try {
                admin.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
    }

    /**
     * 判断指定的表是否存在
     *
     * @param tableName
     * @return
     */
    public static boolean isTableExists(String tableName) {
        Admin admin = null;
        try {
            admin = getAdmin();
            return admin.tableExists(TableName.valueOf(tableName));
        } catch (IOException e) {
            e.printStackTrace();
        } finally {

            try {
