package com.atguigu.dataanalasis.util;

import java.sql.*;

public class JDBCUtil {
    private static final String DRIVER = "com.mysql.jdbc.Driver";
    private static final String URI = "jdbc:mysql://hadoop201:3306/db_telecom?useUnicode=true&characterEncoding=UTF8";
    private static final String USER_NAME = "root";
    private static final String PASSWORD = "aaa";

    private static Connection connection;

    /**
     * 单例模式
     * @return
     */
    public static Connection getInstance() {
        if (connection == null) {
            synchronized (JDBCUtil.class) {
                if (connection == null) {
                    connection = getConnection();
                }
            }
        }
        return connection;
    }

    /**
     * 获取 JDBC 连接
     *
     * @return
     */
    private static Connection getConnection() {
        try {
            Class.forName(DRIVER);
            return DriverManager.getConnection(URI, USER_NAME, PASSWORD);
        } catch (ClassNotFoundException e) {
            e.printStackTrace();
        } catch (SQLException e) {
            e.printStackTrace();
        }
        return null;
    }

    /**
     * 关闭资源
     *
     * @param resultSet
     * @param preparedStatement
     * @param connection
     */
    public static void close(ResultSet resultSet, PreparedStatement preparedStatement, Connection connection) {
        if (resultSet != null) {
            try {
                resultSet.close();
            } catch (SQLException e) {
                e.printStackTrace();
            }
        }

        if (preparedStatement != null) {
            try {
                preparedStatement.close();
            } catch (SQLException e) {
                e.printStackTrace();
            }
        }

        if (connection != null) {
            try {
                connection.close();
            } catch (SQLException e) {
                e.printStackTrace();
            }
        }
    }

}

